import React from 'react';
import { Page, Text, View, Document, StyleSheet,Image } from '@react-pdf/renderer';
import {Table, TR, TH, TD} from '@ag-media/react-pdf-table';
import moment from 'moment';
import "moment/locale/es"
moment.locale("es");  

const styles = StyleSheet.create({
  page: {
    backgroundColor: '#FFFFFF',
    fontSize:10
  },
  section: {
    margin: 10,
    padding: 10,
    flexGrow: 1
  },
  titulo:{
    textAlign: 'center',
    fontSize:"bold",
    backgroundColor: '#000000',
  },
  footer: {
    position: 'absolute',
    bottom: 20,
    left: 0,
    right: 0,
    textAlign: 'center',
  },

});
import { useState,useEffect } from 'react';
// Create Document Component
const MyDocument = ({data,Fecha,Responsables,Tactico,Ocurrencia,esMOto}) => {
    const {IdPlaca,Numero,Kilometraje:{Inicial,Final},Turno:{Turno,HEntrada,HSalida}, Marca,Vale:{NumVale,KM:ValKM} }=data
    return (<Document>
        <Page size="A4" style={styles.page}>
            <View style={{ marginTop:"10px"}}>
              <Image style={{width: "100%"}} src='data:image/jpeg;base64,' />
            </View>
            <View style={{ marginTop:"1px",marginRight:"35px",flexDirection: 'row', justifyContent: 'flex-end',fontWeight:"bold"}}>
              <Text>{Fecha.format('DD [de] MMMM [del] YYYY').toString().toUpperCase()} </Text>
            </View>
            <View style={{ marginTop:"10px",flexDirection: 'row', justifyContent: 'center',fontWeight:"bold"}}>
              <Text>ACTA DE PATRULLAJE MUNICIPAL - {esMOto?"MOTORIZADO":"PATRULLERO"} </Text>
            </View>
            <View style={{marginRight:"35px",marginLeft:"50px",marginTop:"10px"}}>
              <Table  tdStyle={{padding:"1px",fontSize:"8px"}} >
                <TH>
                    <TD weighting={1} style={{justifyContent: 'center',fontWeight:"bold",backgroundColor: '#D1D1D1',}}>DATOS {esMOto?"DE LA MOTO":"DEL VEHICULO"}  AL MOMENTO DEL RELEVO</TD>
                </TH>
                <TR>
                    <TD style={{borderRight: 0,}}>PLACA {esMOto?"DE LA MOTO":"DEL VEHICULO"} </TD>
                    <TD style={{borderLeft: 0,}}>: {IdPlaca} </TD>
                    <TD style={{borderRight: 0,}}>{esMOto?"MOTO":"PATRULLERO"} N°</TD>
                    <TD style={{borderLeft: 0,}}>: 0{Numero} </TD>
                    <TD style={{borderRight: 0,}}>MARCA</TD>
                    <TD style={{borderLeft: 0,}}>: {Marca}</TD>
                </TR>
                <TR>
                    <TD style={{borderRight: 0,}}>KM. DE INICIO DE SERVICIO</TD>
                    <TD style={{borderLeft: 0,}}>: {Inicial.toFixed(1)} </TD>
                    <TD style={{borderRight: 0,}}>KM. DE FIN DE SERVICIO</TD>
                    <TD style={{borderLeft: 0,}}>: {Final.toFixed(1)} </TD>
                    <TD style={{borderRight: 0,}}>TOTAL KM.</TD>
                    <TD style={{borderLeft: 0,}}>: {(Final-Inicial).toFixed(1)} </TD>
                </TR>
                <TR>
                    <TD weighting={1} style={{borderBottom: 0,}}>OBSERVACIONES: </TD>
                </TR>
                <TR style={{height:"50px"}} >
                    <TD weighting={1} style={{borderTop: 0,}}></TD>
                </TR>
                <TR>
                    <TD weighting={0.5}>LLENAR EN CASO DE ABASTECER COMBUSTIBLE</TD>
                    <TD weighting={0.2} style={{borderRight: 0,}}>N° DE VALE</TD>
                    <TD weighting={0.1} style={{borderLeft: 0,}}>: {NumVale || ""}</TD>
                    <TD weighting={0.1} style={{borderRight: 0,}}>KM</TD>
                    <TD weighting={0.1} style={{borderLeft: 0,}}>: {ValKM || ""}</TD>
                </TR>
                <TR style={{height:"40px"}} >
                    <TD weighting={1} style={{justifyContent: 'center',borderBottom: 0,}}></TD>
                </TR>
                <TR style={{borderTop: 0}}>
                    <TD weighting={0.5} style={{justifyContent: 'center',borderTop: 0,borderRight: 0}}><Text>_______________________________ {"\n"} FIRMA DEL CONDUCTOR SALIENTE</Text></TD>
                    <TD weighting={0.5} style={{justifyContent: 'center',borderTop: 0,borderLeft: 0}}><Text>_______________________________ {"\n"} FIRMA DEL CONDUCTOR ENTRANTE</Text></TD>
                </TR>
              </Table>
            </View>
            {Responsables&&<View style={{marginRight:"35px",marginLeft:"50px",marginTop:"10px"}}>
              <Table  tdStyle={{padding:"1px",fontSize:"8px"}} >
                <TH>
                    <TD weighting={1} style={{justifyContent: 'center',fontWeight:"bold",backgroundColor: '#D1D1D1',}}>PARTICIPANTES</TD>
                </TH>
                {Responsables.map((item,key)=>{
                    const {DNI,Rol:{label},Nombres,NCelular}=item
                    return <TR key={key} >
                        <TD>{key+1}. {label||""}</TD>
                        <TD>{DNI||""} </TD>
                        <TD>{Nombres||""}</TD>
                        <TD>{NCelular||""}</TD>
                    </TR>
                })}
              </Table>
            </View>}
            <View style={{marginRight:"35px",marginLeft:"50px",marginTop:"10px"}}>
              <Table  tdStyle={{padding:"1px",fontSize:"8px"}} >
                <TH>
                    <TD weighting={1} style={{justifyContent: 'center',fontWeight:"bold",backgroundColor: '#D1D1D1',}}>UBICACION</TD>
                </TH>
                <TR>
                    <TD weighting={1}>ZONA DE PATRULLAJE : TODO EL DISTRITO DE DESAGUADERO</TD>
                </TR>
                <TR>
                    <TD style={{borderRight: 0,}}>TURNO</TD>
                    <TD style={{borderLeft: 0,}}>: {Turno||""} </TD>
                    <TD style={{borderRight: 0,}}>HORA DE INICIO:</TD>
                    <TD style={{borderLeft: 0,}}>: {HEntrada||""} </TD>
                    <TD style={{borderRight: 0,}}>TERMINO</TD>
                    <TD style={{borderLeft: 0,}}>: {HSalida||""} </TD>
                </TR>
              </Table>
            </View>
            <View style={{marginRight:"35px",marginLeft:"50px",marginTop:"10px"}}>
              <Table  tdStyle={{padding:"1px",fontSize:"8px"}} >
                <TH>
                    <TD style={{justifyContent: 'center',fontWeight:"bold",backgroundColor: '#D1D1D1',}}>CUADRO DE REPORTE DE OCURRENCIAS DEL SERVICIO Y/O ACTA DE INTERVENCION</TD>
                </TH>
                <TR>
                    <TD>
                      <View>
                        <Text>{Tactico}</Text>
                        <Text>{Ocurrencia}</Text>
                      </View>
                    </TD>
                </TR>
              </Table>
            </View>
            <View style={{...styles.footer,marginRight:"35px",marginLeft:"50px",marginTop:"10px"}}>
              <Table  tdStyle={{padding:"1px",fontSize:"8px"}} >
                <TR>
                  <TD weighting={0.25} style={{justifyContent: 'center',border:0}}><Text>_______________________{"\n"}JEFE DE GRUPO</Text></TD>
                  <TD weighting={0.25} style={{justifyContent: 'center',border:0}}><Text>_______________________{"\n"}{esMOto?"MOTORIZADO (1)":"CONDUCTOR"}</Text></TD>
                  <TD weighting={0.25} style={{justifyContent: 'center',border:0}}><Text>_______________________{"\n"}{esMOto?"MOTORIZADO (2)":"OPERADOR"}</Text></TD>
                  <TD weighting={0.25} style={{justifyContent: 'center',border:0}}><Text>_______________________{"\n"}{esMOto?"MOTORIZADO (3)":"PNP"}</Text></TD>
                </TR>
              </Table>
            </View>
        </Page>
    </Document>)
}



export default MyDocument;
